import React, { useEffect, useState } from "react";
import Movie from "./Movie";
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  const [movies,setMovies] = useState([
    {
      Title:'Star wars',
      Poster: 'https://images.unsplash.com/photo-1536440136628-849c177e76a1?ixid=MXwxMjA3fDB8MHxzZWFyY2h8NXx8bW92aWV8ZW58MHx8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60'
    },
    {
      Title:'Avengers',
      Poster: 'https://images.unsplash.com/photo-1536440136628-849c177e76a1?ixid=MXwxMjA3fDB8MHxzZWFyY2h8NXx8bW92aWV8ZW58MHx8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60'
    },
    {
      Title:'Avengers',
      Poster: 'https://images.unsplash.com/photo-1536440136628-849c177e76a1?ixid=MXwxMjA3fDB8MHxzZWFyY2h8NXx8bW92aWV8ZW58MHx8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60'
    }
  ]); 

  const getMovieRequest = async() => {
    const url = 'http://www.omdbapi.com/?s=star wars&apikey=584dd146';

    const response = await fetch(url);
    const responseJSON = await response.json();

    console.log(responseJSON);

  }

  useEffect( () => {
    getMovieRequest();
  })
  return (
    <>
      <div className='container-fluid movie-app'>
        <div className='container'>
          <div className='row'>
          <h1>Aman</h1>
            <Movie movies={movies}/>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
